import React from 'react';

const ImageChangeOnMouseOver = () => {
    return (
        <div>
            <img src="/assets/img/img1.jpg" alt="" style={{width: '200px'}}/>
            <img src="/assets/img/img2.jpg" alt="" style={{width: '200px'}}/>

        </div>
    );
};

export default ImageChangeOnMouseOver;
